import { Injectable } from '@angular/core';
import {HttpClient} from "@angular/common/http";
import {Observable} from "rxjs";
import {ResponseData} from "../models/ResponseData";
import {RegisterData} from "../models/request/RegisterData";
import {FormControl, Validators} from "@angular/forms";

@Injectable({
  providedIn: 'root'
})
export class TournamentService {

  constructor(private http:HttpClient) { }

  // name: new FormControl(null, [Validators.required]),
  // discipline: new FormControl('Dota 2', Validators.required),
  // maxTeams: new FormControl(null, [Validators.required, Validators.min(2), Validators.max(128)]),
  // minTeams: new FormControl(null, [Validators.required, Validators.min(2), Validators.max(128)]),
  // startDate: new FormControl(new Date(), [Validators.required]),
  // tournamentType: new FormControl('SINGLE_ELIMINATION', Validators.required),
  public create(formValues: any): Observable<ResponseData<number>> {
    const name: string = formValues['name'];
    const discipline: string = formValues['discipline'];
    const maxTeams: number = formValues['maxTeams'];
    const minTeams: number = formValues['minTeams'];
    const startDate: Date = formValues['startDate'];
    const tournamentType: string = formValues['tournamentType'];


    return this.http.post<ResponseData<number>>('http://localhost:8080/api/private/admin/tournament', {
      name, discipline, maxTeams, minTeams, startDate, tournamentType
    })
  }
}
